//import { useState } from 'react';

const NextButton = ({disabled}) => {

    //const [disabledCheckVar, setDisabledCheckVar] = useState("disabled")
    
    const disabledCheck = (disabled) => {
        if (disabled === "false" ){
            return "false"
        }
    }
     

    return ( 
        <button disabled = {() => disabledCheck(disabled)}>Next</button>
     );
}
 
export default NextButton;
